import React from 'react';
import styled from 'styled-components';

const HeroSection = styled.section`
  position: relative;
  min-height: 70vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background: #fafbfa;
  padding: 6vw 0 2vw 0;
  overflow: visible;
  @media (max-width: 900px) {
    flex-direction: column;
    align-items: center;
    min-height: 0;
    padding: 2.5rem 0 1.5rem 0;
  }
`;

const HeroContentBlock = styled.div`
  position: relative;
  z-index: 1;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: center;
  background: #fff;
  border-radius: 22px;
  box-shadow: 0 4px 32px 0 rgba(24,75,84,0.07);
  padding: 3.5rem 3.5rem 2.5rem 3.5rem;
  min-width: 0;
  max-width: 540px;
  margin-right: 3vw;
  margin-left: 40px;
  @media (max-width: 900px) {
    margin: 0 auto 2.5rem auto;
    padding: 2.2rem 1.2rem 1.5rem 1.2rem;
    max-width: 98vw;
    align-items: center;
    text-align: center;
  }
`;

const HeroHeading = styled.h1`
  font-family: 'JetBrains Mono', 'Fira Mono', 'Menlo', 'monospace';
  font-size: 2.7rem;
  font-weight: 700;
  color: #222;
  margin: 0 0 1.1rem 0;
  line-height: 1.08;
  letter-spacing: -0.01em;
  .hero-grey {
    color: #b3b3b3;
    font-weight: 400;
  }
  .hero-black {
    color: #222;
    font-weight: 700;
  }
  @media (max-width: 700px) {
    font-size: 1.5rem;
  }
`;

const HeroSubtitle = styled.p`
  font-size: 1.13rem;
  color: #555;
  margin: 0 0 1.7rem 0;
  font-weight: 400;
  max-width: 420px;
  @media (max-width: 700px) {
    font-size: 1.01rem;
    margin-bottom: 1.1rem;
  }
`;

const HERO_HEADING = (
  <>
    <span className="hero-grey">About</span>
    <span className="hero-black" style={{ fontFamily: 'JetBrains Mono, Fira Mono, Menlo, monospace', fontWeight: 700, fontSize: '2.7rem', verticalAlign: 'baseline', marginLeft: '0.5rem' }}>
      Hepta
    </span>
  </>
);
const HERO_SUBTITLE = 'What we do, how we do it, and what we believe in.';

const Section = styled.section`
  max-width: 700px;
  margin: 4.5rem auto 0 auto;
  padding: 0 15px;
`;

const SectionHeading = styled.h2`
  font-size: 2rem;
  font-weight: 700;
  color: #222;
  margin: 0 0 1.2rem 0;
`;

const SectionText = styled.p`
  font-size: 1.18rem;
  color: #222;
  margin: 0 0 2.2rem 0;
  line-height: 1.6;
`;

const About = () => (
  <>
    <HeroSection>
      <HeroContentBlock>
        <HeroHeading>{HERO_HEADING}</HeroHeading>
        <HeroSubtitle>{HERO_SUBTITLE}</HeroSubtitle>
      </HeroContentBlock>
    </HeroSection>
    <Section>
      <SectionHeading>Product innovation</SectionHeading>
      <SectionText>
        Combining our hands-on knowledge of emerging technologies with our experience building new businesses and products, we help companies grow into new markets.
      </SectionText>
      <ul style={{margin: 0, padding: 0, listStyle: 'none', fontSize: '1.13rem', fontWeight: 600, color: '#222'}}>
        <li>Business Strategy</li>
        <li>Insight Development</li>
        <li>Customer validation</li>
        <li>Emerging Tech Discovery</li>
        <li>Rapid Prototyping</li>
        <li>Envisioning Design</li>
      </ul>
    </Section>
    <Section>
      <SectionHeading>Product design</SectionHeading>
      <SectionText>
        From idea to launch, and beyond, our product design team works to efficiently and rapidly define, design and prototype world-class digital products, services or platforms.
      </SectionText>
      <ul style={{margin: 0, padding: 0, listStyle: 'none', fontSize: '1.13rem', fontWeight: 600, color: '#222'}}>
        <li>Product Strategy</li>
        <li>User Research + Testing</li>
        <li>Interactive Prototyping</li>
        <li>Visual Design Systems</li>
        <li>Customer Journeys</li>
        <li>UX Guidelines</li>
      </ul>
    </Section>
    <Section>
      <SectionHeading>Product development</SectionHeading>
      <SectionText>
        Our development team brings ideas to life, building robust, scalable, and maintainable solutions that power digital products and services for the long term.
      </SectionText>
      <ul style={{margin: 0, padding: 0, listStyle: 'none', fontSize: '1.13rem', fontWeight: 600, color: '#222'}}>
        <li>Full Stack Engineering</li>
        <li>API & Backend Development</li>
        <li>Cloud Infrastructure</li>
        <li>DevOps & Automation</li>
        <li>Quality Assurance</li>
        <li>Ongoing Support</li>
      </ul>
    </Section>
  </>
);

export default About;
